import Axios from "axios";

class TodoDataService {
    findAllTodo() {
        return Axios.get('http://localhost:8080/users/todos')
    }

    deleteTodoById(id) {
        return Axios.delete(`http://localhost:8080/users/todos/${id}`)
    }

    updateTodo(id) {
        return Axios.delete(`http://localhost:8080/users/todos/${id}`)
    }

}

export default new TodoDataService()
